func Test_prefix(t *testing.T) {
	out := prefix("flower", "flow")
	require.Equal(t, "flow", out)

	out = prefix("flow", "flower")
	require.Equal(t, "flow", out)

	out = prefix("aflow", "flower")
	require.Equal(t, "", out)

	out = prefix("", "flower")
	require.Equal(t, "", out)

	out = prefix("", "")
	require.Equal(t, "", out)
}
